INSERT INTO `stories` (`id`, `name`, `description`, `category_id`, `created`, `updated`, `status`, `view`, `img`, `author`, `country`) VALUES
(1, 'One Pice', 'truyenej nha', 3, '2017-04-18 04:04:03', '2021-04-22 10:43:59', 1, 6000, 'admin/app/webroot/img/stories/1.jpg', 'Đang cập nhật', 'Nhật Bản'),
(4, 'Hiệp Khách Giang Hồ', 'Câu chuyện xoay quanh nhân vật chính là Hàn Bảo Quân, một kẻ không có võ công nhưng lại có khinh công tuyệt đỉnh và tài bắt chước võ công của người khác dù chỉ nhìn qua một lần. Cùng với Đàm Hoa Liên, cháu gái của Kiếm Hoàng, họ bị cuốn vào bí mật của Phục Ma Hoa Linh Kiếm, 1 trong 8 kỳ vật của võ lâm', 4, '2017-04-18 04:16:24', '2021-04-22 10:41:17', 1, 1900, 'admin/app/webroot/img/stories/4.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(5, 'Hôn Trộm 55 Lần', '', 5, '2017-04-18 04:17:00', '2021-04-04 11:15:28', 1, 1000, 'admin/app/webroot/img/stories/5.jpg', 'Đang cập nhật', 'Việt Nam'),
(7, 'Attack On Titan', 'Hơn 100 năm trước, giống người khổng lồ Titan đã tấn công và đẩy loài người tới bờ vực tuyệt chủng. Những con người sống sót tụ tập lại, xây bao quanh mình 1 tòa thành 3 lớp kiên cố và tự nhốt mình bên trong để trốn tránh những cuộc tấn công của người khổng lồ. Họ tìm mọi cách để tiêu diệt người khổng lồ nhưng không thành công. Và sau 1 thế kỉ hòa bình, giống khổng lồ đã xuất hiện trở lại, một lần nữa đe dọa sự tồn vong của con người....\r\nElen và cô em gái Mikasa phải chứng kiến một cảnh tượng cực kinh khủng - mẹ của mình bị ăn thịt ngay trước mắt. Elen thề rằng cậu sẽ giết tất cả những tên khổng lồ mà cậu gặp...\r\n\r\n', 6, '2017-05-31 03:07:35', '2021-04-12 05:44:09', 1, 4612, 'admin/app/webroot/img/stories/7.jpg', 'Đang cập nhật', 'Nhật Bản'),
(8, 'Fairy Tail', 'Fairy Tail', 3, '2017-05-31 03:09:01', '2021-04-04 10:23:38', 1, 3654, 'admin/app/webroot/img/stories/8.jpg', 'Đang cập nhật', 'Nhật Bản'),
(12, 'Võ Luyện Đỉnh Phong', 'Võ đỉnh phong, là cô độc, là tịch mịch, là từ từ cầu tác, là chỗ cao không thắng hàn\r\nTrong nghịch cảnh trưởng thành, tuyệt địa cầu sinh, bất khuất không buông tha, mới có thể kham phá võ cực kỳ nói.\r\n\r\nLăng Tiêu Các thí luyện đệ tử kiêm quét rác gã sai vặt Dương Khai ngẫu nhiên hoạch một quyển vô tự hắc thư, từ đây bước trên từ từ võ đạo.\r\n******************\r\n\r\nHữu nghị nhắc nhở: Đây là một cái kéo dài nam nhân chuyện xưa, đây cũng là một cái dâm giả thấy dâm, trí giả thấy trí chuyện xưa.\r\nLàm nam nhân, đương kéo dài!', 2, '2017-05-31 03:13:52', '2021-04-22 10:41:05', 1, 44538, 'admin/app/webroot/img/stories/12.jpg', 'Đang cập nhật', 'Trung Quốc'),
(14, 'Hajimete No Gal', 'Lucy là một cô gái 17 tuổi, với giấc mơ trở thành một tinh linh pháp sư thực thụ...\r\n\r\nRồi một ngày cô đến thị trấn Harujion, cô đã gặp Natsu, một thiếu niên có khả năng sử dụng ma thuật lửa.\r\n\r\nNhưng Natsu không phải là một pháp sư thông thường, cậu sử dụng ma thuật cổ đại do một con rồng tên là Igneel dạy dỗ,và là thành viên của một trong số những hội pháp sư nổi tiếng nhất.', 4, '2017-05-31 03:15:35', '2021-04-27 03:44:43', 1, 34836, 'admin/app/webroot/img/stories/14.jpg', 'Đang cập nhật', 'Nhật Bản'),
(15, 'Bokura No Fushidara', 'Bokura No Fushidara', 5, '2017-05-31 03:16:45', '2021-04-04 12:57:37', 1, 1011, 'admin/app/webroot/img/stories/15.jpg', 'Đang cập nhật', 'Nhật Bản'),
(17, 'The Beginning After The End', 'King Grey là người sở hữu tất cả trong một thế giới bị Võ thuật chi phối. Nhưng đi đôi với một sức mạnh to lớn lại là sự cô độc không hồi kết. Thế nên, mặc dù vẻ bên ngoài là một quốc vương mạnh mẽ, nhưng sâu trong thâm tâm lại là một kẻ yếu đuối không có ý chí. Nhưng sau đó lại được tái sinh trong một thế giới fantasy để làm lại một cuộc đời mới. Tuy nhuyên đâu dễ ăn đến thế ? Đằng sau sự hòa bình của thế giới này có vẻ tồn tại một mối đe dọa khủng khiếp nào đó. Với trọng trách lớn lao đó, lý do anh main nhà ta chuyển sinh đến đây là gì ?', 3, '2021-04-04 03:36:02', '2021-04-08 16:13:57', 1, 2123, 'admin/app/webroot/img/stories/17.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(18, 'Bách Luyện Thành Thần', 'Cảnh giới: Luyện nhục cảnh, Luyện cốt cảnh, Luyện tạng cảnh....\r\nLa Chính vì gái mà bị đày làm nô bộc. La Bái Nhiên tham vọng đầy mình :))\r\nLa Chính lại vì gái mà đâm đầu tu luyện :))\r\nLa Gia trong phủ nước sôi lửa bỏng, tranh giành kịch liệt... thôi thì đọc tiếp sẽ biết :)\r\n1 thanh niên dại gái tu luyện võ công =))', 2, '2021-04-05 05:15:16', '2021-04-27 03:14:52', 1, 1777, 'admin/app/webroot/img/stories/18.jpg', 'Đang cập nhật', 'Trung Quốc'),
(20, 'Võ Đang Kỳ Hiệp', 'fdsfsdfds', 6, '2021-04-06 01:18:16', '2021-04-12 03:19:44', 1, 5687, 'admin/app/webroot/img/stories/20.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(32, 'TÔI ĐÃ CHUYỂN SINH THÀNH SLIME', 'Một manga khác chuyển thể từ light novel đang hot ở nhật. Một anh chàng bị tên cướp đâm chết khi đang gặp vợ chưa cưới của đồng nghiệp. Khi đang thoi thóp trước khi chết, người đầy máu, anh ta nghe được một tiếng nói kỳ lạ. Giọng nói ấy chuyển thể sự tiếc nuối của anh chàng vì vẫn còn tân trước khi đi và ban cho anh ta chiêu thức đặc biệt [tiên nhân vĩ đại]. Liệu đây có phải là trò đùa?', 8, '2021-04-08 04:43:38', '2021-04-08 04:47:12', 1, 0, 'admin/app/webroot/img/stories/32.jpg', 'Fuse - KAWAKAMI Taiki', 'Nhật Bản'),
(34, 'gosu cao thủ 2', 'Phần tiếp theo của Gosu Hành trình trả thù cho sư phụ vẫn tiếp tục liệu main có càng ngày càng hơn phần 1 không? các bạn đón xem nhé!', 6, '2021-04-12 03:56:25', '2021-04-22 10:42:21', 1, 0, 'admin/app/webroot/img/stories/34.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(37, 'Võ Sĩ Quyền Anh', 'Huấn luyện viên Boxing huyền thoại K đang tìm người kế thừa, ông đến phòng gym nơi Ryu đang tập và nhìn thấy được tiềm năng trở thành ngôi sao của Ryu. Những tưởng K sẽ nhận Ryu làm học trò ngay lập tức nhưng ông lại vô tình chạm mặt Yu khi cậu đang bị đánh hội đồng tại con hẻm sau phòng gym. Yu lúc đó chỉ biết ngồi yên chịu trận, gương mặt vô cảm nhưng K biết ngay là cậu bé này đang giấu nghề. Ông thuyết phục Yu về làm học trò của mình nhưng cậu bỏ đi vì không có hứng thú. Trong lúc đó, cậu bé Jay - người luôn bị Ryu bắt nạt - vì muốn bảo vệ Yu nên đang lấy hết can đảm để chống lại kẻ thù mạnh hơn mình gấp bội. Cuộc chiến thật sự sắp bắt đầu rồi, các bạn nhớ đón xem nha.', 6, '2021-04-13 10:20:57', '2021-04-13 10:29:07', 1, 0, 'admin/app/webroot/img/stories/37.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(38, 'Pháp Sư Vĩ Đại Trở Lại Sau 4000 Năm', 'Đại phù thủy Lucas Traumen - người mạnh nhất thế giới. Trong một lần đi tiêu diệt quái vật đã khiến thần nổi giận và phạm tội khinh thường Chúa, anh ta bị phong ấn trong địa ngục suốt 4000 năm. Đến khi tỉnh lại thì anh ta đã nhập vào thân xác của Frey Blake - thanh niên yếu nhất thế giới vừa tự sát, và bắt đầu hành trình khôi phục lại sức mạnh để diệt thần.', 8, '2021-04-22 10:30:30', '2021-04-23 04:59:45', 1, 0, 'admin/app/webroot/img/stories/38.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(39, 'Đăng Nhập Murim', 'Một kỷ nguyên mà các thợ săn phát triển mạnh trong việc săn quái vật đến từ Gates. Jin Tae-Kyung là một thợ săn hạng thấp, người nhặt được một cỗ máy VR, và vô tình đăng nhập vào trò chơi, lấy bối cảnh trong thế giới Võ thuật. Sau nhiều thăng trầm, Tae-Kyung đã có thể thoát khỏi thế giới này. Sức mạnh và kỹ năng mà anh ta nhận được trong Murim có thể được đưa trở lại thế giới thực. Điều này cho phép anh ta tiếp tục kiếm sống bằng nghề săn bắn nhưng anh ta quyết định quay trở lại thế giới Murim, để chăm sóc cho những người bạn NPC của mình.', 2, '2021-04-22 10:40:00', '2021-04-23 04:49:17', 1, 0, 'admin/app/webroot/img/stories/39.jpg', 'Đang cập nhật', 'Hàn Quốc'),
(42, 'Tiên Vương Trùng Sinh', 'Bách Lý Vân Tiêu - một đời linh tông ở Cửu Tiêu đại lục, sau khi chết lại hồi sinh trở về 300 năm trước, quay lại thời thiếu niên đô thị, thay đổi cuộc đời, leo lên đỉnh thế giới một lần nữa, trên trời dưới đất, chỉ có ta vô địch!', 6, '2021-04-27 03:17:44', '2021-04-27 03:31:57', 1, 0, 'admin/app/webroot/img/stories/42.jpg', 'Đang cập nhật', 'Trung Quốc'),
(43, 'Tổng Tài Tại Thượng', '“Có thai với tôi rồi mà còn muốn bỏ đi?”Hắn cương quyết bắt cô phải giao ra đứa con cô đã sinh cho hắn vào ba năm trước. Không chịu một lần, hắn lại ép thêm một bận.\r\nTổng tài bất chấp thủ đoạn cố đoạt được tình yêu, cô tìm đủ mọi cách để kháng cự, bấu víu để thoát ra. Được rồi, con của hắn cô sẽ trả cho hắn, nhưng cô sẽ đi! Thế mà hắn vẫn chưa hài lòng, dùng sức ném cô lên giường cùng tiếng hét:\r\n“Cô gái, ta muốn sinh thêm một đứa!”', 4, '2021-04-27 03:33:49', '2021-04-27 03:35:17', 1, 0, 'admin/app/webroot/img/stories/43.jpg', 'Khương Tiểu Nha', 'Trung Quốc');
